void CMovement::bunnyhop(SDK::CUserCmd* cmd)
{
	auto local_player = INTERFACES::ClientEntityList->GetClientEntity(INTERFACES::Engine->GetLocalPlayer());

	if (!local_player)
		return;

	if (cmd->buttons & IN_JUMP)
	{
		int local_flags = local_player->GetFlags();
		if (!(local_flags & FL_ONGROUND))
			cmd->buttons &= ~IN_JUMP;

		if (local_player->GetVelocity().Length() <= 50)
			cmd->forwardmove = 450.f;
	}
}

void CMovement::autostrafer(SDK::CUserCmd* cmd) //thanks toast
{
	auto local_player = INTERFACES::ClientEntityList->GetClientEntity(INTERFACES::Engine->GetLocalPlayer());

	if (!local_player)
		return;

	int local_flags = local_player->GetFlags();
	if (!(local_player->GetFlags() & local_flags & FL_ONGROUND))
	{
		if (cmd->mousedx > 1 || cmd->mousedx < -1)
			cmd->sidemove = cmd->mousedx < 0.0f ? -450 : 450;
		else
		{
			cmd->forwardmove = 4200.0f / local_player->GetVelocity().Length();
			cmd->sidemove = (cmd->command_number % 2) == 0 ? -450 : 450;
			if (cmd->forwardmove >  450)
				cmd->forwardmove = 450;
		}
	}
	else if (cmd->buttons & IN_JUMP)
		cmd->forwardmove = 450;
}

void CMovement::RotateMovement(SDK::CUserCmd* cmd, float rotation)
{
	rotation = DEG2RAD(rotation);

	float cos_rot = cos(rotation);
	float sin_rot = sin(rotation);

	float new_forwardmove = (cos_rot * cmd->forwardmove) - (sin_rot * cmd->sidemove);
	float new_sidemove = (sin_rot * cmd->forwardmove) + (cos_rot * cmd->sidemove);

	cmd->forwardmove = new_forwardmove;
	cmd->sidemove = new_sidemove;
}

bool CMovement::CircularStrafe(SDK::CUserCmd* cmd, Vector& OriginalView)
{
	if (!SETTINGS::settings.othercirclestrafe);
	return false;

	SDK::CBaseEntity* pLocalEntity = INTERFACES::ClientEntityList->GetClientEntity(INTERFACES::Engine->GetLocalPlayer());

	if (!pLocalEntity)
		return false;

	if (!pLocalEntity->IsAlive())
		return false;

	CircleFactor++;
	if (CircleFactor > 360)
		CircleFactor = 0;

	int GetItDoubled = 3.0 * CircleFactor;

	Vector StoredViewAngles = cmd->viewangles;

	int CIRCLEKey;
	if (CIRCLEKey > 0 && GetKeyState(CIRCLEKey))
	{
		cmd->viewangles = OriginalView;
		RotateMovement(cmd, GetItDoubled);
	}
	return true;
}

